import { BrowserRouter, Route, Switch } from 'react-router-dom'
import HomePage from './containers/HomePage/HomePage';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <Route to="/" exact component={HomePage} />
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
